import { useState } from "react"
import Validation from "./Validation"
import style from './Form.module.css'
import { postDog } from "../../redux/action"


const Form = () => {
    const [dogInfo, setDogInfo] = useState({
        name: '',
        image: '',
        height: '',
        weight: '',
        life_span: '',
        temperament: []
    })
    console.log(dogInfo);

    const [errors, setErrors] = useState ({
        name: '',
        image: '',
        height: '',
        weight: '',
        life_span: '',
        temperament: []
    })

    const handleChange = (event) => {
        setDogInfo ({
            ...dogInfo, 
            [event.target.name]: event.target.value
        })

        setErrors(Validation({
            ...dogInfo,
            [event.target.name]: event.target.value
        }))
    }

    const handleSubmit = (event) => {
        event.preventDefault()
        postDog(dogInfo)

    }



    return (
        <div className={style.fondo}> 
        <br/> <br/> <br/>
        <form  onSubmit={handleSubmit}>
            <img src='https://media.tenor.com/Z67_jUyzvicAAAAd/bocchi-the-rock-futari-gotoh.gif' className={style.imagen}/>
            <br/> <br/> <br/> <br/>
            <label className={style.form} >Name: </label>
            <input placeholder="Enter a name" value={dogInfo.name || ''} onChange={handleChange} className={style.input}/>
            {errors.name && <p className={style.advertencia}>{errors.name}</p>}
            <br/> <br/>
            <label className={style.form}>Image: </label>
            <input placeholder="Enter a URL" value={dogInfo.image} onChange={handleChange} className={style.input}/>
            {errors.image && <p className={style.advertencia}>{errors.image}</p>}
            <br/> <br/>
            <label className={style.form}>Height: </label>
            <input placeholder="Enter a height" value={dogInfo.height} onChange={handleChange} className={style.input}/>
            {errors.height && <p className={style.advertencia}>{errors.height}</p>}
            <br/> <br/>
            <label className={style.form}>Weight: </label>
            <input placeholder="Enter a weight" value={dogInfo.weight} onChange={handleChange} className={style.input}/>
            {errors.weight && <p className={style.advertencia}>{errors.weight}</p>}
            <br/> <br/>
            <label className={style.form}>Temperament: </label>
            <input placeholder="Enter a temperament(s)" value={dogInfo.temperament} onChange={handleChange} className={style.input}/>
            {errors.temperament && <p className={style.advertencia}>{errors.temperament}</p>}
            <br/> <br/>
            <label className={style.form}>Life span: </label>
            <input placeholder="Enter a life span" value={dogInfo.life_span} onChange={handleChange} className={style.input}/>
            {errors.life_span && <p className={style.advertencia}>{errors.life_span}</p>}
            <br/> <br/>
            <button className={style.boton}> Create Dog </button>
        </form>
        </div>
    )
}

export default Form
